  false,\n\t\"url\": null,\n\t\"notes\": \" n        As part of monitoring and evaluation
  activities, the Millennium Challenge Corporation (MCC) and Millennium Challenge
  Account-Mongolia (MCA-M) carried out an impact evaluation that examined how the
  securing of long-term land use rights and provision of infrastructure and training
  through PURP affects not just livestock herding efficiency and productivity, but
  also environmental degradation and rangeland quality in peri-urban areas. In support
  of the rangeland quality component of the evaluation, MCC signed an agreement with
  the United States Department of Agriculture (USDA). Under this agreement, USDA provided
  technical advice and support to MCC regarding the monitoring and evaluation of pastureland
  and oversaw a local land quality contractor that carried out evaluation activities
  including the collection of baseline and follow-up data, as well as the training
  of local technicians and officials in sustainable land quality monitoring.n      \",\n\t\"license_title\":
